import '../css/header.css'
import { useNavigate } from 'react-router-dom';

const Header = () => {
    const navigate = useNavigate();

    const handleSearchClick = () => {
      navigate("/search");
    };

    const handleIntroClick = () => {
        navigate("/");
      };

    return (
        <div id="header">            
                <div id="logo"><img src="/logo2.png" alt="Logo" onClick={handleIntroClick} /></div>
                <div><button id="search" onClick={handleSearchClick} >검색</button></div>
            <hr />
        </div>
    )
}
export default Header;
